package main

import "testing"

func TestFindTheDifference(t *testing.T) {
	got := findTheDifference("abcd", "abcde")
	want := byte('e')

	if got != want {
		t.Errorf("got %v, wanted %v", got, want)
	}
}

func TestFindTheDifference2(t *testing.T) {
	got := findTheDifference(
		"",
		"",
	)
	want := byte('t')

	if got != want {
		t.Errorf("got %v, wanted %v", got, want)
	}
}
